#include "pch.h"#ifndef HEAD_H_INCLUDED#define HEAD_H_INCLUDED#define OVERFLOW -1typedef int ElemType;typedef  struct StackNode{	ElemType data;	struct StackNode* next;}StackNode, * LinkStackPtr;typedef  struct  LinkStack{	LinkStackPtr 	 top;	  //栈顶指针	int		 count;  //栈中元素个数}LinkStack;typedef LinkStack* LINK;ElemType MENU();void initStack(LINK* L);  //初始化ElemType stackEmpty(LINK* L);  //判空ElemType stackLength(LINK* L);  //求长度void push(LINK* L);  //入栈void pop(LINK* L);  //出栈ElemType top(LINK* L);  //求栈顶void DestoryStack(LINK* L);  //销毁栈#endif